(68, 4, '2008-11-08 04:46:42', 'Reminder: Change Magento`s default phone numbers and callouts before site launch', 'Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.', NULL, 1, 0),
(69, 4, '2012-04-23 14:02:40', 'Magento Community Preview Version CE 1.7.0.0-RC1 has been released!', 'Learn more about the exciting new features and updates in this release and how you can take it for a test drive. As this is a preview version, we need to stress that it''s likely unstable and that we DON''T recommend that you use it in any production environment just yet.', 'http://www.magentocommerce.com/blog/comments/magento-preview-version-ce-1700-rc1-now-available/', 1, 0),
(70, 4, '2012-05-11 09:46:54', 'Magento Community 1.7 and Magento Enterprise 1.12 now available!', 'Learn more about the exciting new features and updates in these releases.', 'http://www.magentocommerce.com/blog/comments/magento-enterprise-112-and-community-17-now-available/', 1, 0),
(71, 4, '2012-06-20 18:54:07', 'Magento Community Edition 1.7.0.1 now available! ', 'We have just released an updated version of Magento Community Edition, version 1.7.0.1. This update delivers new, minor functionality and fixes for some potential security vulnerabilities.', 'http://www.magentocommerce.com/blog/comments/magento-community-edition-1701-released/', 1, 0),
(72, 4, '2012-07-05 19:21:43', 'Important Security Update - Zend Platform Vulnerability', 'We have recently learned of a serious vulnerability in the Zend platform on which Magento is built. Learn more and access a patch that addresses this issue. ', 'http://www.magentocommerce.com/blog/comments/important-security-update-zend-platform-vulnerability/', 1, 0),
(73, 4, '2012-08-24 22:37:47', 'Increase Your Sales With PayPal', 'Magento merchants using PayPal Express Checkout can help increase their sales on average 18%. It is one simple thing you can do right now to help boost your sales. Learn more.', 'http://www.magentocommerce.com/add-paypal?utm_source=CEModule&utm_medium=copy&utm_content=18&utm_campaign=choosepaypal', 1, 0),
(74, 4, '2011-08-22 13:45:25', 'Magento Absolute theme is available for Magento Go now! ', 'Magento Absolute theme is available for Magento Go now! ', 'http://templates-master.com/magento-templates/free-absolute-magento-go-template.html', 1, 0),
(75, 4, '2011-09-06 13:27:48', 'New Elastic Premium template for Magento is published', 'New Elastic Premium template for Magento is published.', 'http://bit.ly/pf0ilp ', 1, 0),
(76, 3, '2011-09-12 08:37:58', 'Magento 1.6 compatability update', 'All our themes and extensions compatible with Magento 1.6 CE now!  Request your update at http://bit.ly/q51qxj ', 'http://bit.ly/q51qxj ', 1, 0),
(77, 4, '2011-09-19 12:52:59', 'Check our new Affiliate Suite extension for Magento CE', 'Affiliate Suite by Templates Master will help you to build new efficient sales channe. Your new affiliate partners will be able to promote your store by emailing, placing links, banners and other  media on their sites and any social networks profiles.', 'http://bit.ly/oKa0zd ', 1, 0),
(78, 4, '2011-10-12 14:02:30', 'Magento Easybanners 1.1 is now available', 'Easybanners provide easy and powerful tools to manage and target banners to specific users. We are proud to announce that this extension provide support for Magento widgets now. So you can place any banner or placeholder right into your cms page. We have also added option to call out placeholders directly in the phtml templates.', 'http://bit.ly/phgpx5', 1, 0),
(79, 4, '2011-11-04 16:49:59', 'Join us on Facebook and get one time 10% OFF on all our templates and extensions.', 'Join us on Facebook and get one time 10% OFF on all our templates and extensions.', 'http://on.fb.me/rYE7qW ', 1, 0),
(80, 4, '2011-11-08 16:00:10', 'Affiliate Suite 1.0.5  is now available', 'Affiliate Suite by Templates Master will help you to build new efficient sales channel and start offering affiliate programs at your store.\n\nNew features\n- Allow to copy banners\n- Autoselect default campaign on partner registration\n- Ordered products report interface added\n\nBug fixes\n- Prowidget tool hidden on frontend if disableded', 'http://bit.ly/saXDyk', 1, 0),
(81, 4, '2011-11-11 15:40:50', 'Firecheckout 1.6.1 compatability update ', 'Firecheckout is now fully compatible with Magento 1.6.1', 'http://bit.ly/sUDhHK ', 1, 0),
(82, 4, '2011-11-17 16:28:50', 'New Product Highlight extension for Magento is now available!', 'New Product Highlight extension for Magento is now available!', 'http://bit.ly/tGwtwZ ', 1, 0),
