(84, 4, '2011-11-28 15:45:49', 'Cyber Monday Discount! Get 20% off for all our products - code THNK20 ', 'Cyber Monday Discount! Get 20% off for all our products - code THNK20 ', 'http://bit.ly/sBBbSa', 1, 0),
(85, 4, '2011-11-30 15:22:50', 'Helpmate 1.1 is now available', 'Helpmate 1.1 is now available\n\nFeatures:\n- 2 types of contact form. First is default and second one is like http://www.payoneer.com/contactUs.aspx \n- Attach allowed files from emails\n- Akismet integration\n\nBug fix\n- File upload bug in admin fixed', 'http://bit.ly/teCtnm ', 1, 0),
(86, 4, '2011-12-13 13:44:45', 'Magento 1.6.1 compatability update', 'We are glad to inform that recent themes 1.6.1 update also include recent version of Highlight and Easyslide extension.\nRequest your update at http://bit.ly/q51qxj ', 'http://bit.ly/sEHONg ', 1, 0),
(87, 4, '2011-12-21 16:14:11', 'Social Suit extension for Magento is now available!', 'Social Suit - New Facebook & Google social networks integration extension for Magento', 'http://bit.ly/ugYisg ', 1, 0),
(88, 4, '2012-01-12 13:50:11', 'Firecheckout 2.0 is now available.', 'Firecheckout 2.0  is now available with great new features:\n\n- Configurable address form fields sort order\n- Delivery date option\n- Flexible AJAX updates for checkout page\n- Improved overall performance over 30%\n- Now  available in 11 languages (English, Arabic, Chinese Simplified, Dutch, French, German, Italian, Japanese, Korean, Portuguese, Russian, Spanish, Swedish)', 'bit.ly/sUDhHK', 1, 0),
(89, 4, '2012-01-19 16:39:44', 'Magento Affiliate Suite 1.1 and Ajax Pro 1.6.6 are now available.', 'Magento Affiliate Suite 1.1 and Ajax Pro 1.6.6 are now available.', 'http://bit.ly/ycr6uq ', 1, 0),
(90, 4, '2012-01-30 15:10:21', 'Magento Affiliate Suite 1.1.1 is now available', 'Please update your Affialite suite to recent 1.1.1 version.', 'bit.ly/saXDyk', 1, 0),
(91, 4, '2012-02-02 15:26:01', 'Social Suite 1.1 with great new features is now available', '- Twitter integration\n- Allow to login with social networks on checkout page\n- Firecheckout login integration support\n- Floating social panel\n- Improved localization\n', 'http://bit.ly/A8h4yk', 1, 0),
(92, 4, '2012-02-15 14:44:58', 'Lightbox Pro extension for Magento is now available!', 'Lightbox Pro will replace default magento image zoom with new easy-to-use and flexible Lightbox widget. ', 'http://bit.ly/xmm1WU', 1, 0),
(93, 4, '2012-03-12 16:11:39', 'Mobile Star - Android and iPhone theme for Magento is now available!', 'Don’t loose your chance to keep contact with your customers while they are using their phones. We have created Mobile Star Magento theme that will help you join new e-commerce revolution and build your mobile presence just in 5 minutes. Mobile Star is specially designed Magento theme that will work on iPhone, Android  and any other advanced phone. ', 'http://bit.ly/z5XF3M ', 1, 0),
(94, 4, '2012-03-20 13:48:13', 'Mobile Star template for iPhone and Android is compatible with Magento CE 1.4 —1.6 now.', 'Don’t loose your chance to keep contact with your customers while they are using their phones. We have created Mobile Star Magento theme that will help you join new e-commerce revolution and build your mobile presence just in 5 minutes. Mobile Star is specially designed Magento theme that will work on iPhone, Android  and any other advanced phone. ', 'http://bit.ly/GBPp2w', 1, 0),
(95, 4, '2012-04-11 09:44:13', 'Firecheckout 2.1 is now available.', 'Firecheckout 2.1 is now available with great new features:\n\n- Editable shopping cart on checkout page\n- Optionally show products images on checkout page\n- Improved message for the customers using emails that are already in use\n- Improved Fire Checkout page layout\n- Improved performance while saving Fire Checkout configuration', 'http://bit.ly/IqPRSb ', 1, 0),
(96, 4, '2012-04-27 10:36:31', 'Fire Checkout 2.1.1 for Magento CE 1.7 is now available', 'Fire Checkout 2.1.1 for Magento CE 1.7 is now available', 'http://bit.ly/Igy452 ', 1, 0),
(97, 4, '2012-05-04 11:11:25', 'Mobile Star template is now compatible with Magento CE 1.7.0 and 1.4.0', 'Mobile Star template is now compatible with Magento CE 1.7.0 and 1.4.0', 'http://bit.ly/JXXWT4', 1, 0),
(98, 4, '2012-05-10 15:16:19', 'Absolute and classic themes are now compatible with Magento CE 1.7.0', 'Absolute and classic themes are now compatible with Magento CE 1.7.0', 'http://bit.ly/Jk7p4F ', 1, 0),
(99, 4, '2012-05-15 14:05:03', 'Firecheckout is now compatible with Magento Enterprise edition.', 'Firecheckout is now compatible with Magento Enterprise edition.', 'http://bit.ly/JQqvRi ', 1, 0),
(100, 4, '2012-05-24 19:39:46', 'Prolabels 2.0 with unlimited labels support now available!', 'Prolabels 2.0 is now available with great new features:\n\n- Unlimited number of labels\n- Flexible condition rules\n- Optimized for large catalogs', 'http://bit.ly/MKP9ou ', 1, 0),
(101, 4, '2012-05-25 14:40:31', 'Helpmate with great new features and Magento CE 1.7 support is now available', ' Helpmate 1.2 is now available with great new features:\n\n- Private tickets responses not visible to users.\n- Create ticket buttons on order and customer admin pages\n- Multiply select option for storeviews on kb articles page\n- Categories and Articles sort order in KB\n- Improve search and suggest algorithm of KB articles\n- Ajax Search compatibility ', 'http://bit.ly/LhSTwf ', 1, 0),
(102, 4, '2012-05-30 16:07:16', 'Magento templates are now compatible with Magento CE 1.7', 'We are glad to inform that all our templates were recently updated to Magento CE 1.7. Request your update at http://bit.ly/q51qxj ', 'http://bit.ly/KHFrQY', 1, 0),
(103, 4, '2012-06-22 14:22:54', 'Prolabels 2.1 is now available', 'Prolabels 2.1 is now available with next new features and bugfixes:\n\n- Performance update\n- Active products grid interface added for labels\n- Out of stock label text option added\n- Catalog indexes conflict fixed', 'http://bit.ly/LGESFz', 1, 0),
(104, 4, '2012-07-05 14:12:33', 'Firecheckout 2.2 is now available.', 'Fire Checkout 2.2 is now available with great new features:\n\n- 5 custom order fields added\n- Hide other shipping methods, if free is applicable (optional)\n- Nice looking styles on our Mobile Star theme\n- Improved positioning of the popup window and spinner on mobile devices\n- Fixed conflict with Magento''s _canShowForUnregisteredUsers method.\n- In order to improve Fire Checkout compatibility with third party extensions "Enable Agreements" option was removed. Please use Magento standard config option instead. You can find it at the checkout options section.', 'http://bit.ly/N8Cyqi', 1, 0),
(105, 4, '2012-07-25 14:07:32', 'Prolabels 2.2 is now available', 'Prolabels 2.2 is now available with next new features\n\n- Unlimited number of system labels\n- Improved localization for system labels\n', 'http://bit.ly/Qj65pj', 1, 0),
(106, 4, '2012-08-01 15:26:13', 'Ajax Layered Navigation 1.1 is now available', 'Ajax Layered Navigation 1.1 is now available with next new features\n\n- Two new layered navigation styles: vertical layered navigation and drop down layered navigation\n- Limit number of filters to show\n- Improved Magento 1.7 compatibility\n- Improved price ranges algorithm\n', 'http://bit.ly/ODpjUN', 1, 0),
(107, 4, '2012-08-09 14:31:48', 'Ajax Pro 2.0  is now available', 'Ajax Pro 2.0  is now available with next new features\n\n- completely refactored extension logic for better performance and better compatibility\n- javascript login form added', 'http://bit.ly/Na3k8u', 1, 0),
(108, 4, '2012-08-17 15:17:07', 'Social Suite 1.2 with Pinterest integration is now available', 'Social Suite 1.2  is now available with next new features\n\n- Pinterest integration\n', 'http://bit.ly/N8Mcu0', 1, 0),
(109, 4, '2012-08-27 14:15:31', 'Ajax Pro 2.0.1 update is now available', 'Ajax Pro 2.0.1  is now available with next new features\n\n- Ajax Pro links and actions disabled for search engines spiders\n', 'http://bit.ly/PVixZE', 1, 0),
(110, 4, '2012-08-30 19:16:37', 'Helpmate 1.2.1 is now available', 'Helpmate 1.2.1  is now available with next new features\n\n- Captcha support for Magento 1.7\n- Frontend layout field label alignment fixed\n- File uploaded type javascript validation added\n- Order info field is now optional\n- Improved admin tickets message format\n\n', 'http://bit.ly/UdSddX', 1, 0),
(111, 4, '2012-11-19 20:27:42', 'Wrap up more holiday sales with financing', 'Give your customers up to 6 months financing. You get paid right away with Bill Me Later, a PayPal service. It’s a great way to extend financing in time for the holidays. Learn More.', 'http://www.magentocommerce.com/paypal/billmelater?utm_source=CEMessaging&utm_medium=copy&utm_content=sixmonths&utm_campaign=BML', 0, 0),
(112, 4, '2013-01-15 22:02:07', 'Imagine 2013 Registration is Now Open!', 'Join 1500 merchants, partners, developers and enthusiasts from 35+ countries around the world for Magento’s premier global conference! Collaborate, learn, network and get inspired by the future of eCommerce. Tickets will sell out fast! April 8th – 10th in Las Vegas.', 'https://registration.imagineecommerce.com/', 0, 0),
(113, 4, '2013-02-12 17:53:42', 'Get More eCommerce Power with Magento Enterprise', 'Limited time offer: Get a free, customized evaluation of your Community Edition site from a Magento Solution Partner. This evaluation gives you a clear look at the numerous benefits you can achieve by upgrading to Enterprise Edition. ', 'http://www.magentocommerce.com/community-to-enterprise?utm_source=CEMM&utm_medium=copy&utm_campaign=CE2EE', 0, 0),
(114, 2, '2013-09-27 17:28:13', 'Magento Community Edition 1.8.0.0 - now available for download!', 'Get tax, security, performance, and many other improvements. \n\nLearn more at http://www.magentocommerce.com/blog/comments/magento-community-edition-one-eight-now-available/ ', 'http://www.magentocommerce.com/blog/comments/magento-community-edition-one-eight-now-available/', 0, 0),
(115, 4, '2013-12-11 15:35:06', 'Magento Community Edition 1.8.1.0 is here!', 'This new version offers significant tax calculation, product quality, and security enhancements. Be sure to carefully review the upgrade instructions before starting. More information is available at http://www.magentocommerce.com/blog/comments/magento-community-edition-1810-is-here/', 'http://www.magentocommerce.com/blog/comments/magento-community-edition-1810-is-here/', 0, 0),
(116, 4, '2013-12-12 23:24:39', 'Important Magento Community Edition Patch', 'A security patch is available for Magento Community Edition 1.4.0.0 through 1.7.0.2; the issue has been fixed in Magento Community Edition 1.8.0.0 and later. It resolves a vulnerability discovered through our quarterly penetration testing process and has not been reported by merchants. We encourage all merchants to apply the patch in their next regularly scheduled maintenance cycle. The patch is available at http://www.magentocommerce.com/download in the Magento Community Edition Patches section.', 'http://www.magentocommerce.com/download', 0, 0),
(117, 4, '2014-01-21 18:34:48', 'PHP 5.4 Patch Now Available', 'Magento is advancing its platform and making development more efficient by adding support for PHP 5.4. Patches are available for download at www.magentocommerce.com/download and you can learn more about this update in our blog post at http://www.magentocommerce.com/blog/comments/magento-now-supports-php-54 .', 'http://www.magentocommerce.com/blog/comments/magento-now-supports-php-54', 0, 0),
(118, 4, '2014-02-20 17:51:46', 'Discover Card Validation Patch Available', 'A patch that resolves an issue with validating Discover credit cards is now available for download at http://www.magentocommerce.com/download. More information on the patch is available in the Magento Knowledge Base at http://www.magentocommerce.com/knowledge-base/entry/discover-card-validation', 'http://www.magentocommerce.com/knowledge-base/entry/discover-card-validation ', 0, 0),
(119, 4, '2014-03-04 15:12:26', 'Learn How to Quickly Increase Sales on Your Site', 'Adding the PayPal Express Checkout button to your checkout page can help increase sales 18% on average. It’s fast and easy and you can do it right now to boost sales. Express Checkout is already seamlessly integrated into Community Edition.', 'http://magento.com/paypal/CE_Express_Checkout_NA?utm_source=messagemodule&utm_medium=message&utm_campaign=Ceexpresscheckout', 0, 0),
(120, 4, '2014-05-13 16:46:11', 'Magento Community Edition 1.9 is now available!', 'It accelerates your entry into the mobile commerce space by slashing the time and cost of getting a mobile device-friendly responsive site.  And a new Bill Me Later payment option helps boost your sales. Visit http://magento.com/blog/magento-news/magento-enables-responsive-sites-half-time to learn more.', 'http://magento.com/blog/magento-news/magento-enables-responsive-sites-half-time', 0, 0),
(121, 4, '2014-10-08 04:55:06', 'It’s still not too late: Boost your 2014 Holiday sales today.', 'See results in as little as one week with eBay Enterprise Display and 2 business days with eBay Enterprise Affiliate. DID YOU KNOW: Get access to over 128 million highly qualified shoppers on eBay.com with eBay Enterprise Display. And the average retail client using product retargeting sees a $10 to $1 ROI on retargeting spend during Q4. With the eBay Enterprise Affiliate Network, get access to over 200,000 active network publishers across 30+ verticals, and only pay when a customer makes a purchase (Affiliate Network is only available in the U.S. & Canada).  GET STARTED TODAY by visiting www.ebayenterprise.com/turbochargesales', 'http://www.ebayenterprise.com/turbochargesales', 0, 0),
(122, 4, '2014-11-12 19:03:26', 'Important: PayPal Users Must Discontinue Using SSL 3.0 By December 3, 2014', 'To address a vulnerability with the SSL 3.0 security protocol, PayPal and other payment gateways will be disabling SSL 3.0 support. Merchants must upgrade to Transport Layer Service (TLS) by December 3, 2014 to avoid PayPal payment operation failures. Learn more about what you need to do at https://devblog.paypal.com/poodle-ssl-3-0-vulnerability/', 'https://devblog.paypal.com/poodle-ssl-3-0-vulnerability/', 0, 0),
(123, 4, '2014-11-24 23:25:21', 'Magento Community Edition 1.9.1 is available!', 'Magento Community Edition 1.9.1 empowers merchants to deliver compelling shopping experiences by offering enhanced responsive design capabilities, new swatches to display product variations, and improved performance through support for MySQL 5.6 and PHP 5.5. It also includes support for Google Universal Analytics and over 70 product improvements. Find out more at http://magento.com/blog/magento-news/magento-community-edition-191-now-available-download', 'http://magento.com/blog/magento-news/magento-community-edition-191-now-available-download', 0, 0),
(124, 4, '2015-01-22 17:47:08', 'Join Us at Imagine Commerce 2015 - April 20-22 at the Wynn Las Vegas', 'Join Magento, eBay Enterprise, and over 2,000 merchants, developers, and eCommerce experts at the premier Commerce event of the year. With three days of cutting-edge keynote presentations, special technical programs, dynamic breakout sessions, and incredible networking opportunities, Imagine Commerce 2015 will educate, enrich, and inspire you to take your business to new heights. Register now at http://imagine2015.magento.com/.', 'http://imagine2015.magento.com/', 0, 0),
(125, 1, '2015-04-16 16:17:07', 'Critical Reminder: Download and install Magento security patches.  Download now.', 'Download and implement 2 important security patches (SUPEE-5344 and SUPEE-1533) from the Magento Community Edition download page (https://www.magentocommerce.com/products/downloads/magento/).  If you have not done so already, download and install 2 previously-released patches that prevent an attacker from remotely executing code on Magento software.  These issues affect all versions of Magento Community Edition.  A press release from Check Point Software Technologies in the coming days will make one of these issues widely known, possibly alerting hackers who may try to exploit it.  Ensure the patches are in place as a preventative measure before the issue is publicized.', 'https://www.magentocommerce.com/products/downloads/magento/ ', 0, 0),
(126, 1, '2015-04-19 22:37:00', 'Second Reminder: Download and install Magento critical security patches now.', 'If you have not done so already, download and install 2 previously-released security patches (SUPEE-5344 and SUPEE-1533) from the Magento Community Edition download page (https://www.magentocommerce.com/products/downloads/magento/).  These security issues affect all versions of Magento Community Edition and enable an attacker to remotely execute code on Magento software. A press release from Check Point Software Technologies tomorrow  will make one of these issues widely known, possibly alerting hackers who may try to exploit it.  Ensure the patches are in place as a preventative measure before the issue is publicized.', 'https://www.magentocommerce.com/products/downloads/magento/', 0, 0),
(127, 1, '2015-04-23 19:43:31', 'Urgent: Immediately install Magento critical security patches', 'It is critical for you to download and install 2 previously-released security patches (SUPEE-5344 and SUPEE-1533) from the Magento Community Edition download page (https://www.magentocommerce.com/products/downloads/magento/).  Please do this immediately, as Check Point Software Technologies has published a technical description of how they discovered the issue, which we feel might serve as a tutorial for implementing an attack against your website. ', 'https://www.magentocommerce.com/products/downloads/magento/', 0, 0),
(128, 1, '2015-05-15 00:34:01', 'Important: New Magento Security Patch - Install it Now', 'It is important for you to download and install a new security patch (SUPEE-5994) from the Magento Community Edition download page (https://www.magentocommerce.com/products/downloads/magento/).  Please apply this critical update immediately to help protect your site from exposure to multiple security vulnerabilities impacting all versions of the Magento Community Edition software. Please note that this patch should be installed in addition to the recent Shoplift patch (SUPEE-5344).', 'https://www.magentocommerce.com/products/downloads/magento/', 0, 0),
(129, 4, '2015-07-07 16:28:25', 'Now available:  Enhanced site quality and security with Community Edition 1.9.2', 'Magento Community Edition 1.9.2 is now available for download and features over 105 product improvements, nearly 170 automated functional tests to help internal development teams improve implementation quality and time to market, and several security enhancements. Read our blog announcement for more information (http://magento.com/blog/magento-news/magento-community-edition-192-now-available), or go to the Community Edition download page to get the software today (https://www.magentocommerce.com/products/downloads/magento/).', 'https://www.magentocommerce.com/products/downloads/magento/', 0, 0);
INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(130, 1, '2015-07-07 17:08:05', 'July 7, 2015: New Magento Security Patch (SUPEE-6285) – Install Immediately', 'Today we are providing a new security patch (SUPEE-6285) that addresses critical security vulnerabilities. The patch is available for Community Edition 1.4.1 to 1.9.1.1 and is part of the core code of our latest release, Community Edition 1.9.2, available for download today.  PLEASE NOTE:  You must first implement SUPEE-5994 to ensure SUPEE-6285 works properly. Download Community Edition 1.9.2 or the patch from the Community Edition download page: https://www.magentocommerce.com/products/downloads/magento/  ', 'https://www.magentocommerce.com/products/downloads/magento/', 0, 0),
(131, 1, '2015-08-04 17:28:26', 'August 4, 2015: New Magento Security Patch (SUPEE-6482) – Install Immediately', 'Today we are providing a new security patch (SUPEE-6482) that addresses 4 security issues; two issues related to APIs and two cross-site scripting risks. The patch is available for Community Edition 1.4 and later releases and is part of the core code of Community Edition 1.9.2.1, which is available for download today. Before implementing this new security patch, you must first implement all previous security patches. Download Community Edition 1.9.2.1 or the patch from the Community Edition download page at https://www.magentocommerce.com/products/downloads/magento/  ', 'https://www.magentocommerce.com/products/downloads/magento/  ', 0, 0),
(132, 2, '2015-08-05 20:12:55', 'August 5, 2015:  Security Patch (SUPEE-6482) Release Note CORRECTION', 'When we announced a new security patch (SUPEE-6482) for Community Edition yesterday we incorrectly said that it addresses 4 issues. It actually addresses 2 security issues: Autoloaded File Inclusion in Magento SOAP API and a SSRF Vulnerability in WSDL File. The patch and Community Edition 1.9.2.1 are complete, fully-tested, and ready to deploy. We strongly encourage you to deploy the patch or upgrade to the latest version of Community Edition if you haven’t done so already. You can find the patch at https://www.magentocommerce.com/products/downloads/magento/. ', 'https://www.magentocommerce.com/products/downloads/magento/', 0, 0),
(133, 4, '2015-10-01 17:32:53', 'Episode VI: Return of Imagine Commerce | 2016 Registration is Open!', 'The force is strong with this one. Join the Magento rebellion at Imagine Commerce 2016. Enlist Now at http://imagine.magento.com.', 'http://imagine.magento.com', 0, 0),
(134, 1, '2015-10-21 00:28:05', 'New Malware Issue. Make Sure You Have Implemented All Security Patches', 'We have received reports that some Magento sites are being targeted by Guruincsite malware (Neutrino exploit kit). We have NOT identified a new attack vector at this time. Nearly all the impacted sites checked so far were vulnerable to a previously identified and patched issue; sites not vulnerable to that issue show other unpatched issues. Visit the Magento Security Center at http://magento.com/security/news/important-security-update for more information on how to address this issue and make sure that you have implemented all recent security patches.\n', 'http://magento.com/security/news/important-security-update', 0, 0),
(135, 1, '2015-10-27 21:48:23', 'October 27, 2015: New Magento Security Patch (SUPEE-6788) – Install Immediately', 'Today, we are releasing a new patch (SUPEE-6788) and Community Edition 1.9.2.2 to address 10+ security issues, including remote code execution and information leak vulnerabilities. This patch is unrelated to the Guruincsite malware issue. Be sure to test the patch in a development environment first, as it can affect extensions and customizations. Download the patch from the Community Edition Download page and learn more at http://magento.com/security/patches/supee-6788  ', 'http://magento.com/security/patches/supee-6788  ', 0, 0),
(136, 1, '2015-11-18 00:25:00', 'New JavaScript Malware Issue. Make sure your site is secure.', 'Magento Commerce has received reports of a JavaScript malware exploit that forwards credit card information from checkout pages to an external site. No new attack vector has been identified. It appears most impacted sites have not implemented the February 2015 Shoplift patch, or the patch was implemented after the site was already compromised. Information on how to identify and remove the malicious code is available on the Magento Security Center at http://magento.com/security/news/new-javascript-malware-issue', 'http://magento.com/security/news/new-javascript-malware-issue ', 0, 0),
(137, 4, '2015-11-18 21:40:40', 'Magento 2.0 Is Available!', 'Magento 2.0, our next generation open source digital commerce platform is here!  Magento 2.0 offers enhanced performance and scalability, new features to deliver better shopping experiences and conversion rates, and business agility and productivity improvements.  Learn more http://magento.com/blog/magento-news/new-era-commerce-innovation.\n\n', 'http://magento.com/blog/magento-news/new-era-commerce-innovation', 0, 0),
(138, 4, '2016-01-13 22:51:52', 'Have questions? Magento has big answers at Imagine Commerce.', 'Big news, bigger experts, and an even bigger ecosystem. Will you be at Imagine Commerce? Join us. ', 'http://imagine.magento.com', 0, 0),
(139, 1, '2016-01-20 22:17:19', 'Important: New Security Patch (SUPEE-7405) and Release – 1/20/2016', 'Today, we are releasing a new patch (SUPEE-7405) and Community Edition 1.9.2.3 to improve the security of Magento sites. There are no confirmed attacks related to the security issues, but certain vulnerabilities can potentially be exploited to access customer information or take over administrator sessions. You can download the patch and release from the Community Edition Download Page and learn more at https://magento.com/security/patches/supee-7405. ', 'https://magento.com/security/patches/supee-7405', 0, 0),
(140, 1, '2016-02-24 08:06:43', 'Important: Updates to SUPEE-7405 Security Patch and Release – 2/23/2016', 'Updated versions of the recent SUPEE-7405 patch and Community Edition 1.9.2.3 release are now available. The updates add support for PHP 5.3 and address issues with upload file permissions, merging carts, and SOAP APIs experienced with the original release. They DO NOT address any new security issues, but all merchants should upgrade to the new versions to maintain compatibility with future releases. You can learn more about the updates at https://magento.com/security/patches/supee-7405', 'https://magento.com/security/patches/supee-7405', 0, 0),
(141, 1, '2016-03-31 00:25:07', 'Protect Your Business from Brute-Force Password Guessing Attacks', 'We just posted an article on the Magento Security Center that shares best practices for protecting stores from brute-force password guessing attacks. We’ve recently been made aware of a rise in these attacks, so we strongly recommend that you review the approaches outlined in this article with your developer and hosting provider immediately and implement the ones that are best suited to your unique situation. Learn more at https://magento.com/security/best-practices/protect-your-magento-installation-password-guessing ', 'https://magento.com/security/best-practices/protect-your-magento-installation-password-guessing ', 0, 0),
(142, 4, '2016-06-23 16:44:34', 'Increase your sales and productivity, while simplifying PCI compliance with exciting new Magento Community Edition 2.1 features.', 'Shoppers can now check out faster using credit cards stored with PayPal and a redesigned PayPal checkout. PCI compliance is easier thanks to Braintree Hosted Fields. Admin tools are redesigned to help you work more efficiently. Upgrade to Enterprise Edition for new Content Staging and Preview and Enhanced Site Search capabilities.', 'https://magento.com/blog/magento-news/magento-enterprise-edition-21-unleashes-power-marketers-and-merchandisers ', 0, 0),
(143, 1, '2016-10-12 20:30:13', 'Community Edition 1.9.3 and SUPEE-8788 Provide Critical Security & Functional Updates – 10/12/2016', 'Community Edition 1.9.3 and SUPEE-8788 resolve multiple security issues, including critical vulnerabilities with certain payment methods and Zend Framework libraries. Community Edition 1.9.3 also includes over 120 product quality enhancements and support for PHP 5.6. Learn more about the security issues at https://magento.com/security/patches/supee-8788 and functional updates at http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1930 ', 'https://magento.com/security/patches/supee-8788 ', 0, 0),
(144, 1, '2016-10-25 16:51:10', 'Dirty COW Linux OS Vulnerability – 10/25/2016', 'Dirty COW (CVE-2016-5195) is a serious vulnerability affecting most Linux Operating Systems that can be exploited to gain root access to the server. More information on how to immediately update your Linux OS is available in the Magento Security Center at https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability. ', 'https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability', 0, 0),
(145, 4, '2016-11-14 21:08:04', 'Community Edition 1.9.3.1 is Now Available – 11/14/2016', 'Community Edition 1.9.3.1 addresses issues encountered by some merchants in our October 12 product releases. All merchants should either upgrade to Community Edition 1.9.3.1 or apply our latest patch, SUPEE-8788, to close several serious security vulnerabilities. More information is available in the release notes at: http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1931 ', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1931 ', 0, 0),
(146, 1, '2017-01-14 02:33:20', 'New Zend Framework Security Vulnerability – 1/13/2017', 'We’ve found a new vulnerability in a Zend Framework 1 and 2 email component used by all Magento 1 and Magento 2 software (as well as other PHP solutions). This vulnerability is serious and can lead to a remote code execution attack if your servers use Sendmail as a mail transport agent. Learn how to protect your sites at https://magento.com/security/news/new-zend-framework-1-security-vulnerability\n\n', 'https://magento.com/security/news/new-zend-framework-1-security-vulnerability', 0, 0),
(147, 4, '2017-01-19 16:58:24', 'New Magento DevBox Beta Speeds Magento 2 Setup – 1/19/2017', 'Magento DevBox Beta makes it faster and easier than ever to setup your Magento 2 development environment. Read our blog post to find out more at: https://magento.com/blog/technical/set-your-magento-2-development-environment-faster.', 'https://magento.com/blog/technical/set-your-magento-2-development-environment-faster', 0, 0),
(148, 1, '2017-02-07 20:03:15', 'Community Edition 1.9.3.2 and SUPEE-9652 Resolve Zend Framework Security Issue – 2/7/2017', 'Community Edition 1.9.3.2 and the SUPEE-9652 patch resolve the recent Zend Framework 1 Security vulnerability. Review the Magento Security Center post for more information:  https://magento.com/security/patches/supee-9652', 'https://magento.com/security/patches/supee-9652', 0, 0),
(149, 4, '2017-02-17 21:07:28', 'Inspirational athlete, Serena Williams, will join Magento at Imagine 2017.', 'Imagine 2017 will bring together 3000+ international commerce experts to exchange ideas on the future of commerce. Don’t miss this opportunity to hear from inspirational athlete, Serena Williams, and Stella & Dot CEO, Jessica Herrin. Join us in Las Vegas, April 3-5. Register Now at https://imagine.magento.com/\n', 'https://imagine.magento.com/', 0, 0),
(150, 1, '2017-05-31 20:03:50', 'Community Edition 1.9.3.3 and SUPEE-9767 Security Enhancements – 5/31/2017', 'Community Edition 1.9.3.3 and SUPEE-9767 includes critical security enhancements. Review the Security Center update for more information: https://magento.com/security/patches/supee-9767', 'https://magento.com/security/patches/supee-9767', 0, 0),
(151, 2, '2017-06-13 18:20:53', 'New Patch for PayPal Instant Payment Notification (IPN) Changes. Upgrade to 1.9.3.3 or SUPEE-8167 by June 30, 2017 to Avoid Service Disruptions – 6/13/2017', 'As of June 30, 2017, PayPal Instant Payment Notifications will no longer allow you to use HTTP to post messages back to PayPal for verification. To comply with these changes, all merchants using PayPal must upgrade to Community Edition 1.9.3.3 or apply the SUPEE-8167 patch. Updates must be in place by June 30, 2017 to avoid any service disruptions. The patch is available on the Community Edition Download Page (https://magento.com/tech-resources/download) and more information is available from PayPal at https://www.paypal-knowledge.com/infocenter/index?page=content&widgetview=true&id=FAQ1916&viewlocale=en_US\n\n', 'https://magento.com/tech-resources/download ', 0, 0);
