INSERT INTO `aw_blog` (`post_id`, `title`, `post_content`, `status`, `created_time`, `update_time`, `identifier`, `user`, `update_user`, `meta_keywords`, `meta_description`, `comments`, `tags`, `short_content`) VALUES
(1, 'Excepteur sint occaecat', '<img style="float: left;  margin-right: 20px;" src="{{media url="wysiwyg/blog_img/small_2.jpg"}}" alt="" />\r\n<p>This stage can get a little confusing but I hope to simplify as much as possible. The Headroom plugin requires a large amount of CSS, but unfortunately this isn&rsquo;t clarified on the plugin&rsquo;s homepage. My demo CSS file is split into different code sections and towards the bottom you&rsquo;ll find a whole bunch of animations and keyframes using CSS3 properties. In order to get your page working you should copy this CSS into your own stylesheet. Various classes pertain to different animations where the header bar will slide up out of view or slide down into view.</p>\r\n\r\n<p> My demo CSS file is split into different code sections and towards the bottom you&rsquo;ll find a whole bunch of animations and keyframes using CSS3 properties. In order to get your page working you should copy this CSS into your own stylesheet. Various classes pertain to different animations where the header bar will slide up out of view or slide down into view This stage can get a little confusing but I hope to simplify as much as possible. The Headroom plugin requires a large amount of CSS, but unfortunately this isn&rsquo;t clarified on the plugin&rsquo;s homepage. My demo CSS file is split into different code sections and towards the bottom you&rsquo;ll find a whole bunch of animations and keyframes using CSS3 properties. In order to get your page working you should copy this CSS into your own stylesheet. Various classes pertain to different animations where the header bar will slide up out of view or slide down into view.</p>', 1, '2010-09-06 07:28:34', '2015-02-12 15:30:18', 'Excepteur', 'Joe Blogs', 'admin admins', 'Keywords', 'Description', 0, '', '<img style="float: left; margin-right: 20px;" src="{{media url="wysiwyg/blog_img/small_2.jpg"}}" alt="" /><p>This stage can get a little confusing but I hope to simplify as much as possible. The Headroom plugin requires a large amount of CSS, but unfortunately this isn&rsquo;t clarified on the plugin&rsquo;s homepage.</p>'),
(2, 'Headroom JS Method', '<img style="float: left;  margin-right: 20px;" src="{{media url="wysiwyg/blog_img/small_4.jpg"}}" alt="" />  <p>Moving back into the HTML file open a new script tag at the very bottom before closing the body section. We need to use a large block of JS to initialize the Headroom plugin class while passing some optional parameters.\r\n\r\nThe header variable targets the initial #header ID and stores this element to pass into the Headroom method. This element is all we actually need to initiate the plugin, but some optional parameters allow you to customize the effect.\r\n\r\nThe first option tolerance is one of two object literals in this set. Basically it takes a list of key/value pairs and passes them into the function or method. The numeric values represent scrolled pixels before the header should re-appear or disappear. So for example once the header slides out of view the user needs to scroll 5px up before it slides back into view.</p>', 1, '2015-02-12 15:43:48', NULL, 'JS_Method', 'admin admins', 'admin admins', '', '', 0, '', '<img style="float: left;  margin-right: 20px;" src="{{media url="wysiwyg/blog_img/small_4.jpg"}}" alt="" />Moving back into the HTML file open a new script tag at the very bottom before closing the body section. We need to use a large block of JS to initialize the Headroom plugin class while passing some optional parameters.'),
