ock.phtml</td>\r\n        </tr>\r\n         <tr>\r\n            <td>9.</td>\r\n            <td>menu_banner</td>\r\n            <td>menu_banner</td>\r\n            <td>menu_banner</td>\r\n            <td>sources\\demo\\static_blocks\\menu_banner.phtml</td>\r\n        </tr>\r\n        <tr>\r\n            <td>10.</td>\r\n            <td>header_info</td>\r\n            <td>header_info</td>\r\n            <td>header_info</td>\r\n            <td>sources\\demo\\static_blocks\\header_info.phtml</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n', '2015-02-13 14:20:18', '2015-02-16 12:26:41', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
